import React from "react";
import PlayerCard from "./playerCard";

function SearchList({ filteredPersons }) {
    const filtered = filteredPersons.map(person => <li style='display:block'> <PlayerCard key={person.player_id}  player={person} /></li>); 
    return (
      <div>
          <ul>
          {filtered}
          </ul>

      </div>
    );
  }

  export default SearchList
